import React from 'react'
import styled from 'styled-components'

function Home() {
    return (
        <Container>
            <ContainerInside>
                <p>---- GET HELP. GET BETTER ----</p>


            </ContainerInside>
        </Container>
    )
}

export default Home

const Container = styled.main`
min-height: calc(100vh - 70px);
padding: 0 calc(3.5vw + 5px);
position:relative;
overflow:hidden;

&:before{
    background:url("../images/02 2 1.jpg") center center / cover
    no-repeat fixed;
    content:"";
    position:absolute;
    top:0;
    left:0;
    right:0;
    bottom:0;
    z-index:-1;
} 
`
const ContainerInside = styled.div`
padding:155px 738px 510px 180px;
p{
    font-height:19px;
    width:522px;
    color:red;
    letter-spacing:1.42px;

}

`
